@danielamram3 הפוך: אין מידע נכון בציוץ, מלבד העובדה הבסיסית שניסתה להתאבד

כל היתר זה ספקולציות שלך - שהופרכו ע"י הילדה עצמה

אבל אני מבין שאתה חסר תקנה - אז אאחל לך רק להצליח להירדם בלילה

@danielamram3 היא כ"כ חוששת לספר לאביה, ולכן היא מספרת לכל העולם שהיא לא מסכימה עם מרבית תפיסת עולמו

פחד אינסופי

https://t.co/eUXg2BrnKJ

@Amichaishiffer רע מאד. כל מי שמכיר דינמיקה של משרדי ממשלה, בדגש על עוצמתם
של הפקידים, מבין את המשמעות של שר עם שעון חול ידוע מראש (לפני המועד הקבוע בחוק)

כל הרעיון של ממשלה שתשלוט לאורך שנים ארוכות הוא יציבות והטמעת מדיניות - לא בשביל לשחק בכסאות מוסיקליים

¹⁹לא מנע מהם להשתיק את אחד הסיפורים הגדולים ביותר בתולדות העיתונות האמריקנית - אם לא הגדול שבהם

הסיפור הזה פשוט בלתי נתפס - בעיקר אם זוכרים שה-FBI קיבל את הלפטופ זמן רב לפני שנחשף הסיפור

ה-FBI לא רק שלא עשה כלום עם הלפטופ, אלא גם לא טרח ליידע את הציבור שהמידע במחשב אותנטי &gt;&gt;

³הביידנ'ס - תוך ניגוד עניינים מובהק

האנטר, בעל בעיות התמכרות קשות, זכה לשבת בדירקטוריונים של חברות זרות ולקבל ערימות של כסף - לא בגלל הכישרון והניסיון שאין לו, אלא לפי החשד כדי לנצל קרבתו המשפחתית לג'ו ביידן - סגן נשיא ארה"ב

לפי החשיפה, ביידן האב לא רק שלא הרחיק עצמו מעסקי &gt;&gt;

²אך קודם כל קצת רקע

ב-14 באוקטובר 2020, כשלושה שבועות לפני הבחירות בין ביידן לטראמפ, פרסם 'ניו יורק פוסט' סיפור מטלטל:
חומרים מתוך הלפטופ של האנטר ביידן, בנו של ג'ו, החושפים כיצד ניצל לכאורה ביידן האב את מעמדו כסגן נשיא (של אובמה) כדי לקדם את העסקים המשפחתיים חובקי העולם של &gt;&gt;

RT @Torat_IDF: שימו לב, דובר צה"ל רן כוכב, שולח חיילות להתראיין נגד חברי כנסת. 
אחר כך יסבירו לנו שאסור שחיילים יתעסקו בפוליטיקה.
